import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState, useEffect } from 'react';
import { Table } from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import axios from 'axios';
import { NavLink, useParams } from 'react-router-dom';


const OrderGetById = () => {
    const{displayOrderId} = useParams();
  const [orders, setOrders] = useState([]);

  useEffect(() => {
    loadUsers();
  }, []);

  const loadUsers = async () => {
    const result = await axios.get(`http://localhost:8080/getcustomerorderbydispid/${displayOrderId}`);
    setOrders(result.data);
  };

;
  return (
    <div>

      <div style={{
        marginTop: "100px", marginLeft: "200px",
        overflow: "auto", width: "1000px", height: "400px", boxShadow: ' 5px 5px 10px #808080'
      }}>
        <NavLink to="/placeod">
          <Button variant="primary">place order</Button>
        </NavLink>
        <h1 style={{ background: "#87CEFA", textAlign: 'center', color: "white" }}>Read Order Details </h1>
        <Table striped bordered hover size="sm">
          <thead className='thead-dark'>
            <tr>
              <th>displayOrderId</th>
              <th>customerName </th>
              <th>productName</th>
              <th>mobileNo</th>
              <th>modelNo</th>
              <th>brandName</th>
              <th>ProductColor </th>
              <th>category</th>
              <th>subCategory</th>
              <th>discription</th>
              <th>orderDate </th>
              <th>expectedDeliveryDate</th>
              <th>logisticName</th>
              <th>awbNo</th>
              <th>couponCode </th>
              <th>action </th>
            </tr>
          </thead>
          <tbody >
            {
              orders.map((orders,displayOrderId) => (
                <tr key={displayOrderId+1}>
                  <td>{orders.customerName}</td>
                  <td>{orders.productName}</td>
                  <td>{orders.mobileNo}</td>
                  <td>{orders.modelNo}</td>
                  <td>{orders.brandName}</td>
                  <td>{orders.ProductColor}</td>
                  <td>{orders.category}</td>
                  <td>{orders.subCategory}</td>
                  <td>{orders.discription}</td>
                  <td>{orders.orderDate}</td>
                  <td>{orders.expectedDeliveryDate}</td>
                  <td>{orders.logisticName}</td>
                  <td>{orders.awbNo}</td>
                  <td>{orders.couponCode}</td>
                  <td><NavLink to = "updateorder/:id"><Button variant="primary">Update order</Button></NavLink></td>
                  <td> <Button variant="outline-primary">Veiw</Button></td>
                  <td> <Button variant="danger">Delete</Button></td>
                </tr>
              )
              )
            }
          </tbody>
        </Table>
      </div>
    </div>
  );
}

export default OrderGetById
